import React, { useEffect, useState } from "react";

function UserTodos({ users, todos, clickHandler }) {
  return (
    <div>
      {users.map((user) => (
        <h1 key={user.id} onClick={() => clickHandler(user.id)}>
          {user.name}
        </h1>
      ))}
      {todos}
    </div>
  );
}

export default UserTodos;
